/* Procedure structure for procedure `sp_asociacion` */

drop procedure if exists `sp_asociacion`;

DELIMITER $$

CREATE DEFINER=`root`@`%` PROCEDURE `sp_asociacion`(
IN i_opcion integer,
IN i_rol integer,
IN i_menu integer,
IN i_usuario char(14),
IN i_empleado integer,
IN i_submenu integer
)
BEGIN
IF (i_opcion = 1) THEN
select mnu_nombre as MENU_PRINCIPAL, sub_nombre as SUB_MENU from frm_submenu sb, frm_menu m, frm_submenu_rol rm
where sb.mnu_id = m.mnu_id
and   sb.sub_id = rm.sub_id
and   rol_id = i_rol;
END IF;
IF (i_opcion = 2) THEN
select sub_id, sub_nombre from frm_submenu
where    mnu_id = i_menu;
END IF;
IF (i_opcion = 3) THEN

END IF;
IF (i_opcion = 4) THEN
select emp_codigo from frm_empleado where emp_usr = i_usuario into @w_emp_codigo;
if exists(select 1 from frm_usr_rol where rol_id = i_rol and emp_codigo =  @w_emp_codigo) then
update frm_usr_rol
set usr_estado = 'V'
where emp_codigo = (select emp_codigo from frm_empleado where emp_usr = i_usuario)
and rol_id= i_rol;
else

end if;
END IF;
IF (i_opcion = 5) THEN
select ro.rol_id ROL, ro.rol_descripcion DESCRIPCION, i_usuario USUARIO, ur.usr_estado ESTADO
from frm_usr_rol ur, frm_rol ro
where ur.emp_codigo = (select emp_codigo from frm_empleado where emp_usr = i_usuario)
and ro.rol_id = ur.rol_id ;
END IF;
IF (i_opcion = 6) THEN
delete from frm_submenu_rol where sub_id = i_submenu and rol_id= i_rol;
END IF;
IF (i_opcion = 7) THEN
update frm_usr_rol
set usr_estado = 'E'
where emp_codigo = (select emp_codigo from frm_empleado where emp_usr = i_usuario)
and rol_id= i_rol;
END IF;
IF (i_opcion = 8) THEN  
SELECT mnu_id, mnu_nombre FROM frm_menu;
END IF;
IF (i_opcion = 9) THEN  
SELECT rol_id, rol_descripcion FROM frm_rol;
END IF;
END$$

DELIMITER ;

/* Procedure structure for procedure `sp_calculo_stock` */

drop procedure if exists `sp_calculo_stock`;

DELIMITER $$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_calculo_stock`()
BEGIN
DECLARE done2 INT DEFAULT 0;
DECLARE w_existencia int default 0;
DECLARE w_producto varchar(20);
DECLARE w_precio float;
declare existencia cursor for
select sum(exi_existencia) , pro_codigo from frm_existencia
group by pro_codigo
;
DECLARE continue HANDLER FOR not found SET done2 = 1;
drop table if exists stock;
create  temporary table stock(
tm_producto varchar(20),
tm_cantidad int,
tm_total    float
);
open existencia; 
existencia_loop:  LOOP
fetch existencia into w_existencia, w_producto;
if done2 = 1 then
leave existencia_loop;
end if;
if w_existencia > 0 then
select pro_parent from frm_producto
where pro_codigo = w_producto into @w_parent;
set @w_cant_dest =1;
if @w_parent !=  w_producto then
SELECT trs_cant_destino FROM frm_prm_traslado
where pro_cod_origen= @w_parent
and pro_cod_destino = w_producto into @w_cant_dest;
end if;
if @w_cant_dest > 1 then
select ifnull(max(c.com_id),0) from frm_compra c, frm_cdetalle d
where c.com_id = d.com_id
and c.com_estado = 'A'
and d.pro_codigo = @w_parent into @w_max;
if @w_max > 0 then
select cdet_precio from frm_cdetalle
where com_id = @w_max
and pro_codigo = @w_parent into @w_precio;

end if;
else
select ifnull(max(c.com_id),0) from frm_compra c, frm_cdetalle d
where c.com_id = d.com_id
and c.com_estado = 'A'
and d.pro_codigo = w_producto into @w_max;
if @w_max > 0 then
select cdet_precio from frm_cdetalle
where com_id = @w_max
and pro_codigo = w_producto into @w_precio;

end if;
end if;  
end if; 
end loop existencia_loop;
close existencia;
select * from stock;
END$$

DELIMITER ;

