DECLARE w_pro_codigo varchar(20);
DECLARE w_emp_codigo  int default 0;
DECLARE w_cantidad int default 0;
DECLARE w_cont int default 0;
DECLARE w_ccantidad int default 0;



    declare venta cursor for /*CURSO QUE DEVUELVE LOS PRODUCTOS POR EMPLEADO EN UN RANGO DE FECHA*/
    SELECT pro_codigo, emp_codigo, sum(vdet_cantidad) FROM frm_venta v, frm_vdetalle vd
    where v.vta_codigo = vd.vta_codigo
    and v.vta_estado = 'A'
    and date_format(v.vta_fecha, '%Y-%m-%d') > date_format(i_fecha_ini, '%Y-%m-%d')
    and date_format(v.vta_fecha, '%Y-%m-%d') <= date_format(i_fecha_fin, '%Y-%m-%d')
    group by pro_codigo, emp_codigo
    order by emp_codigo;

    DECLARE EXIT HANDLER FOR NOT FOUND SET done = 1;


    drop table if exists temp;

create temporary table temp(
    pro_codigo varchar(20),
    cdet_subtotal float,
    cdet_cantidad int,
    com_id int,
    emp_codigo int
);

    open  venta;
    venta_loop: LOOP


       fetch venta into w_pro_codigo, w_emp_codigo, w_cantidad; /*ASIGNAMOS VALORES DEL CURSOR*/
       set w_cont = 0;

        bloq: begin /*BLOQUE DE COMPRA*/

          compra_loop: LOOP /*BLOQUE QUE PROMEDIA LAS COMPRAS*/




           if exists (select 1 from temp where pro_codigo = w_pro_codigo and emp_codigo = w_emp_codigo) then

            select  max(c.com_id)
            from frm_cdetalle cd, frm_compra c
            where pro_codigo = w_pro_codigo
            and c.com_id = cd.com_id
            and c.com_estado = 'A'
            and date_format(c.com_fecha, '%Y-%m-%d') <= date_format(i_fecha_fin, '%Y-%m-%d')
            and c.com_id < (select min(com_id) from temp where pro_codigo = w_pro_codigo and emp_codigo = w_emp_codigo)
            into @w_max;

           else

            select  max(c.com_id)
            from frm_cdetalle cd, frm_compra c
            where pro_codigo = w_pro_codigo
            and c.com_id = cd.com_id
            and c.com_estado = 'A'
            and date_format(c.com_fecha, '%Y-%m-%d') <= date_format(i_fecha_fin, '%Y-%m-%d')
            into @w_max;

           end if;

           if @w_max is null then
             call sp_comisiones_dos(i_fecha_ini, i_fecha_fin, w_pro_codigo, w_emp_codigo, w_cantidad);
             leave compra_loop;
           end if;

             select cdet_cantidad, cdet_subtotal  FROM frm_cdetalle
             where pro_codigo = w_pro_codigo
             and   com_id = @w_max
             into @w_ccantidad, @w_subtotal;

             set w_cont = w_cont + @w_ccantidad;

              select ifnull(sum(cdet_cantidad),0) from frm_cdetalle cd, frm_compra c
             where cd.com_id = c.com_id
             and c.com_estado = 'A'
             and date_format(c.com_fecha, '%Y-%m-%d') > date_format(i_fecha_ini, '%Y-%m-%d')
             and pro_codigo = w_pro_codigo
             into @w_cantidad_compra;

             SELECT ifnull(sum(vdet_cantidad),0) FROM frm_venta v, frm_vdetalle vd
             where v.vta_codigo = vd.vta_codigo
             and date_format(v.vta_fecha, '%Y-%m-%d') > date_format(i_fecha_ini, '%Y-%m-%d')
             and v.vta_estado = 'A'
              and vd.pro_codigo = w_pro_codigo
              into @w_cantidad_venta;

             select sum(exi_existencia)
             from frm_existencia
             where pro_codigo = w_pro_codigo
             into @w_existe;

             set @w_existencia = (@w_existe - @w_cantidad_compra) + @w_cantidad_venta;
             set w_ccantidad = w_cont + @w_existencia;
             set @w_bandera = @w_existe + @w_cantidad_venta;




             if  @w_bandera <= w_ccantidad /*@w_existencia <= w_cont*/ then

                select sum(cdet_subtotal) / sum(cdet_cantidad)
                from temp
                where emp_codigo = w_emp_codigo
                and  pro_codigo = w_pro_codigo
                into @w_pcompra;

                 SELECT ifnull((sum(vdet_subtotal) / sum(vdet_cantidad)),0) FROM frm_venta v, frm_vdetalle vd
                 where v.vta_codigo = vd.vta_codigo
                 and v.vta_estado = 'A'
                 and date_format(v.vta_fecha, '%Y-%m-%d') > date_format(i_fecha_ini, '%Y-%m-%d')
                 and date_format(v.vta_fecha, '%Y-%m-%d') <= date_format(i_fecha_fin, '%Y-%m-%d')
                 and vd.pro_codigo = w_pro_codigo
                 into @w_pventa;

                 select emp_nombre
                 from frm_empleado
                 where emp_codigo = w_emp_codigo
                 into @w_emp_nombre;

                 select pro_nombre, pro_descripcion
                 from frm_producto
                 where pro_codigo = w_pro_codigo
                 into @w_pro_nombre, @w_pro_desc ;







                leave compra_loop;
             end if;



            if done = 1 then
              leave venta_loop;
            end if;

          end loop compra_loop;

        end bloq;

     end loop venta_loop;

   close venta;

END$$

DELIMITER ;

/* Procedure structure for procedure `sp_comisiones_dos` */

drop procedure if exists `sp_comisiones_dos`;

DELIMITER $$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_comisiones_dos`(
in i_fecha_ini varchar(12),
in i_fecha_fin varchar(12),
in i_pro_codigo varchar(20),
in i_emp_codigo int,
in i_cantidad   int
)
BEGIN
DECLARE done INT DEFAULT 0;
DECLARE w_cont int default 0;
DECLARE w_pro_codigo varchar(20) default 0;
DECLARE w_ccantidad int default 0;
drop table if exists temp2;
create temporary table temp2(
pro_codigo varchar(20),
cdet_subtotal float,
cdet_cantidad int,
com_id int,
emp_codigo int
);
select pro_parent from frm_producto
where pro_codigo = i_pro_codigo
into w_pro_codigo;
select trs_cant_destino/trs_cant_origen from frm_prm_traslado
where pro_cod_origen = w_pro_codigo 
and  pro_cod_destino = i_pro_codigo 
into @w_parametro;
bloq: begin 
compra_loop: LOOP 
if exists (select 1 from temp2 where pro_codigo = i_pro_codigo and emp_codigo = i_emp_codigo) then
select  max(c.com_id)
from frm_cdetalle cd, frm_compra c
where pro_codigo = w_pro_codigo
and c.com_id = cd.com_id
and c.com_estado = 'A'
and date_format(c.com_fecha, '%Y-%m-%d') <= date_format(i_fecha_fin, '%Y-%m-%d')
and c.com_id < (select min(com_id) from temp2 where pro_codigo = i_pro_codigo and emp_codigo = i_emp_codigo)
into @w_max;
else
select  max(c.com_id)
from frm_cdetalle cd, frm_compra c
where pro_codigo = w_pro_codigo
and c.com_id = cd.com_id
and c.com_estado = 'A'
and date_format(c.com_fecha, '%Y-%m-%d') <= date_format(i_fecha_fin, '%Y-%m-%d')
into @w_max;
end if;
if (@w_max is null or @w_parametro is null) then
leave compra_loop;
end if;
select cdet_cantidad, cdet_subtotal  FROM frm_cdetalle
where pro_codigo = w_pro_codigo
and   com_id = @w_max
into @w_ccantidad, @w_subtotal;
set w_cont = w_cont + @w_ccantidad;
select ifnull(sum(cdet_cantidad),0) from frm_cdetalle cd, frm_compra c
where cd.com_id = c.com_id
and c.com_estado = 'A'
and date_format(c.com_fecha, '%Y-%m-%d') > date_format(i_fecha_ini, '%Y-%m-%d')
and pro_codigo = w_pro_codigo
into @w_cantidad_compra;
SELECT ifnull(sum(vdet_cantidad),0) FROM frm_venta v, frm_vdetalle vd
where v.vta_codigo = vd.vta_codigo
and date_format(v.vta_fecha, '%Y-%m-%d') > date_format(i_fecha_ini, '%Y-%m-%d')
and v.vta_estado = 'A'
and vd.pro_codigo = w_pro_codigo
into @w_cantidad_venta;
SELECT ifnull(sum(vdet_cantidad),0)/@w_parametro FROM frm_venta v, frm_vdetalle vd
where v.vta_codigo = vd.vta_codigo
and date_format(v.vta_fecha, '%Y-%m-%d') > date_format(i_fecha_ini, '%Y-%m-%d')
and v.vta_estado = 'A'
and vd.pro_codigo = i_pro_codigo
into @w_cantidad_venta_medias;
select sum(exi_existencia)
from frm_existencia
where pro_codigo = w_pro_codigo
into @w_existe;
select sum(exi_existencia) / @w_parametro
from frm_existencia
where pro_codigo = i_pro_codigo
into @w_existe_medias;
set @w_existencias = @w_existe + @w_existe_medias;
set @w_cantidad_v = @w_cantidad_venta + @w_cantidad_venta_medias;
set @w_existencia = (@w_existencias - @w_cantidad_compra) + @w_cantidad_v;
set w_ccantidad = w_cont + @w_existencia;
set @w_bandera = @w_existencias + @w_cantidad_v;

if  @w_bandera <= w_ccantidad  then
select (sum(cdet_subtotal) / sum(cdet_cantidad))/@w_parametro
from temp2
where emp_codigo = i_emp_codigo
and  pro_codigo = i_pro_codigo
into @w_pcompra;
SELECT ifnull((sum(vdet_subtotal) / sum(vdet_cantidad)),0) FROM frm_venta v, frm_vdetalle vd
where v.vta_codigo = vd.vta_codigo
and v.vta_estado = 'A'
and date_format(v.vta_fecha, '%Y-%m-%d') > date_format(i_fecha_ini, '%Y-%m-%d')
and date_format(v.vta_fecha, '%Y-%m-%d') <= date_format(i_fecha_fin, '%Y-%m-%d')
and vd.pro_codigo = i_pro_codigo
into @w_pventa;
select emp_nombre
from frm_empleado
where emp_codigo = i_emp_codigo
into @w_emp_nombre;
select pro_nombre, pro_descripcion
from frm_producto
where pro_codigo = i_pro_codigo
into @w_pro_nombre, @w_pro_desc ;

leave compra_loop;
end if;
end loop compra_loop;
end bloq;
END$$

DELIMITER ;

/* Procedure structure for procedure `sp_consulta_cv` */

drop procedure if exists `sp_consulta_cv`;

DELIMITER $$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_consulta_cv`(
in i_tipo char(10),
in i_opcion int,
in id_cv    int
)
BEGIN
IF (i_tipo  = 'Venta') THEN
IF (i_opcion = 1) THEN
select vta_codigo,
vta_fecha,
vta_total,
suc_nombre,
emp_nombre
from frm_venta v , frm_empleado e, frm_sucursal s
where v.vta_codigo = id_cv
and  v.emp_codigo = e.emp_codigo
and  v.suc_codigo = s.suc_codigo
and  v.vta_estado = 'A';
END IF;
IF (i_opcion = 2 ) THEN
drop table if exists temporal;
create temporary table temporal (
CODIGO char(14),
NOMBRE  VARCHAR(60),
DESCRIPCION VARCHAR(60),
PRESENTACION VARCHAr(60),
CANTIDAD INT,
SUBTOTAL FLOAT
);

select p.pro_codigo , p.pro_nombre ,
p.pro_descripcion , pr.pre_descripcion,
d.vdet_cantidad, d.vdet_subtotal
from frm_vdetalle d, frm_producto p, frm_presentacion pr, frm_venta v
where d.vta_codigo = id_cv
and pr.pre_codigo = pro_presentacion
and p.pro_codigo = d.pro_codigo
and v.vta_codigo = d.vta_codigo
and v.vta_estado = 'A';
select CODIGO, NOMBRE, DESCRIPCION, PRESENTACION, CANTIDAD, FORMAT(SUBTOTAL, 2) as SUBTOTAL from temporal;
END IF;
END IF;
IF (i_tipo  = 'Compra') THEN
IF (i_opcion = 1) THEN
select pv.prov_nombre as Proveedor,
com_fecha as Fecha,
com_total as Total,
s.suc_nombre as Bodega,
e.emp_nombre as Empleado
from frm_compra c , frm_empleado e, frm_sucursal s, frm_proveedor pv
where c.com_id = id_cv
and  c.emp_codigo = e.emp_codigo
and  c.suc_codigo = s.suc_codigo
and  pv.prov_id = com_proveedor
and  c.com_estado = 'A'
;
END IF;
IF (i_opcion = 2 ) THEN
drop table if exists temporal;
create temporary table temporal (
CODIGO char(14),
NOMBRE  VARCHAR(60),
DESCRIPCION VARCHAR(60),
PRESENTACION VARCHAr(60),
CANTIDAD INT,
SUBTOTAL FLOAT
);

select p.pro_codigo, p.pro_nombre,
p.pro_descripcion , pr.pre_descripcion,
d.cdet_cantidad, d.cdet_subtotal
from frm_cdetalle d, frm_producto p, frm_presentacion pr, frm_compra c
where d.com_id = id_cv
and pr.pre_codigo = pro_presentacion
and p.pro_codigo = d.pro_codigo
and c.com_id = d.com_id
and c.com_estado = 'A'
;
select CODIGO, NOMBRE, DESCRIPCION, PRESENTACION, CANTIDAD, FORMAT(SUBTOTAL, 2) as SUBTOTAL from temporal;
END IF;
END IF;
END$$

DELIMITER ;

/* Procedure structure for procedure `sp_empleado` */

drop procedure if exists `sp_empleado`;

DELIMITER $$

CREATE DEFINER=`root`@`%` PROCEDURE `sp_empleado`(
IN i_tipo integer,
IN i_codigo integer,
IN i_nombre varchar(120),
IN i_tel varchar(20),
IN i_dir varchar(120),
IN i_sueldo float,
IN i_puesto varchar(40),
IN i_usr char(14),
IN i_clave varchar(80),
IN i_estado char(1)
)
BEGIN
IF (i_tipo = 1) THEN
select ifnull(max(emp_codigo), 0) + 1 from frm_empleado into @w_emp;

END IF;
IF (i_tipo = 2) THEN
if (i_clave = 'MISMA' ) THEN
update frm_empleado
set emp_nombre = i_nombre,
emp_tel = i_tel,
emp_direccion = i_dir,
emp_sueldo = i_sueldo,
emp_puesto = i_puesto,
emp_usr = i_usr,
emp_estado = i_estado
where emp_codigo = i_codigo;
else
update frm_empleado
set emp_nombre = i_nombre,
emp_tel = i_tel,
emp_direccion = i_dir,
emp_sueldo = i_sueldo,
emp_puesto = i_puesto,
emp_usr = i_usr,
emp_clave = md5(i_clave),
emp_estado = i_estado
where emp_codigo = i_codigo;
END if;
END IF;
END$$

