/* Procedure structure for procedure `sp_finanzas` */

drop procedure if exists `sp_finanzas`;

DELIMITER $$

CREATE DEFINER=`root`@`%` PROCEDURE `sp_finanzas`(
IN i_id_ie integer,
IN i_tipo char(1),
IN i_opcion integer,
IN i_fecha_ini VARCHAR(10),
IN i_fecha_fin VARCHAR(10)
)
BEGIN
IF (i_tipo = 'I') THEN 
IF (i_opcion  = 1) THEN 
SELECT ie_monto as MONTO, ie_descripcion AS DESCRIPCION, ie_fecha as FECHA
FROM frm_ingresos_egresos
WHERE ie_tipo = 'I'
AND   ie_cuenta = 2
AND date_format(ie_fecha, '%Y-%m-%d') >= date_format(i_fecha_ini, '%Y-%m-%d')
AND date_format(ie_fecha, '%Y-%m-%d') <= date_format(i_fecha_fin, '%Y-%m-%d')
UNION
SELECT vta_total, 'VENTA PRODUTO', vta_fecha
FROM frm_venta
WHERE date_format(vta_fecha, '%Y-%m-%d') >= date_format(i_fecha_ini, '%Y-%m-%d')
AND date_format(vta_fecha, '%Y-%m-%d') <= date_format(i_fecha_fin, '%Y-%m-%d')
;
END IF;
IF (i_opcion = 2) THEN 
drop table if exists temporal;
create temporary table temporal (
tm_cuenta varchar(120),
tm_monto  float,
tm_cantidad int
);
SELECT ifnull(count(*),0), ifnull(sum(ie_monto),0)
FROM frm_ingresos_egresos
WHERE ie_tipo = 'I'
AND ie_cuenta = 1
AND date_format(ie_fecha, '%Y-%m-%d') >= date_format(i_fecha_ini, '%Y-%m-%d')
AND date_format(ie_fecha, '%Y-%m-%d') <= date_format(i_fecha_fin, '%Y-%m-%d')
into @w_numero, @w_monto;

