AND date_format(vta_fecha, '%Y-%m-%d') <= date_format(i_fecha_fin, '%Y-%m-%d')
into @w_numero2, @w_monto2;
SET @w_tot = @w_monto + @w_monto2;
SET @w_num = @w_numero + @w_numero;

SELECT ifnull(count(*), 0), ifnull(sum(ie_monto), 0)
FROM frm_ingresos_egresos
WHERE ie_tipo = 'I'
AND ie_cuenta = 3
AND date_format(ie_fecha, '%Y-%m-%d') >= date_format(i_fecha_ini, '%Y-%m-%d')
AND date_format(ie_fecha, '%Y-%m-%d') <= date_format(i_fecha_fin, '%Y-%m-%d')
into @w_numero, @w_monto;

SELECT tm_cuenta as CUENTA, tm_cantidad as NUMERO, tm_monto as MONTO FROM temporal;
END IF;
IF (i_opcion = 3) THEN 
drop table if exists temporal;
create temporary table temporal (
tm_cuenta varchar(120),
tm_monto  float,
tm_cantidad int
);
SELECT ifnull(count(*), 0), ifnull(sum(ie_monto),0)
FROM frm_ingresos_egresos
WHERE ie_tipo = 'I'
AND ie_cuenta = 1
AND date_format(ie_fecha, '%Y-%m-%d') >= date_format(i_fecha_ini, '%Y-%m-%d')
AND date_format(ie_fecha, '%Y-%m-%d') <= date_format(i_fecha_fin, '%Y-%m-%d')
into @w_numero, @w_monto;

SELECT ifnull(count(*), 0), ifnull(sum(ie_monto), 0)
FROM frm_ingresos_egresos
WHERE ie_tipo = 'I'
AND ie_cuenta = 2
AND date_format(ie_fecha, '%Y-%m-%d') >= date_format(i_fecha_ini, '%Y-%m-%d')
AND date_format(ie_fecha, '%Y-%m-%d') <= date_format(i_fecha_fin, '%Y-%m-%d')
into @w_numero, @w_monto;

SELECT ifnull(count(*), 0), ifnull(sum(ie_monto), 0)
FROM frm_ingresos_egresos
WHERE ie_tipo = 'I'
AND ie_cuenta = 3
AND date_format(ie_fecha, '%Y-%m-%d') >= date_format(i_fecha_ini, '%Y-%m-%d')
AND date_format(ie_fecha, '%Y-%m-%d') <= date_format(i_fecha_fin, '%Y-%m-%d')
into @w_numero, @w_monto;

SELECT tm_cuenta as CUENTA, tm_cantidad as NUMERO, tm_monto as MONTO FROM temporal;
END IF;
IF (i_opcion = 4
) THEN 
drop table if exists temporal;
create temporary table temporal (
tm_cuenta varchar(120),
tm_monto  float,
tm_cantidad int
);
SELECT ifnull(count(*), 0), ifnull(sum(vta_total), 0)
FROM frm_venta
WHERE date_format(vta_fecha, '%Y-%m-%d') >= date_format(i_fecha_ini, '%Y-%m-%d')
AND date_format(vta_fecha, '%Y-%m-%d') <= date_format(i_fecha_fin, '%Y-%m-%d')
into @w_numero, @w_monto;

SELECT tm_cuenta as CUENTA, tm_cantidad as NUMERO, tm_monto as MONTO FROM temporal;
END IF;
IF (i_opcion = 5) THEN 
SELECT ie_monto as MONTO, ie_descripcion AS DESCRIPCION, ie_fecha as FECHA
FROM frm_ingresos_egresos
WHERE ie_tipo = 'I'
AND   ie_cuenta = 2
AND date_format(ie_fecha, '%Y-%m-%d') >= date_format(i_fecha_ini, '%Y-%m-%d')
AND date_format(ie_fecha, '%Y-%m-%d') <= date_format(i_fecha_fin, '%Y-%m-%d')
;
END IF;
IF (i_opcion = 6) THEN 
SELECT vta_total, 'VENTA PRODUTO', vta_fecha
FROM frm_venta
WHERE date_format(vta_fecha, '%Y-%m-%d') >= date_format(i_fecha_ini, '%Y-%m-%d')
AND date_format(vta_fecha, '%Y-%m-%d') <= date_format(i_fecha_fin, '%Y-%m-%d')
;
END IF;
IF (i_opcion = 7) THEN 
SELECT ie_monto as MONTO, ie_descripcion AS DESCRIPCION, ie_fecha as FECHA
FROM frm_ingresos_egresos
WHERE ie_tipo = 'I'
AND   ie_cuenta = 3
AND date_format(ie_fecha, '%Y-%m-%d') >= date_format(i_fecha_ini, '%Y-%m-%d')
AND date_format(ie_fecha, '%Y-%m-%d') <= date_format(i_fecha_fin, '%Y-%m-%d')
;
END IF;
IF (i_opcion = 8) THEN 
SELECT ie_monto as MONTO, ie_descripcion AS DESCRIPCION, ie_fecha as FECHA
FROM frm_ingresos_egresos
WHERE ie_tipo = 'I'
AND   ie_cuenta = 1
AND date_format(ie_fecha, '%Y-%m-%d') >= date_format(i_fecha_ini, '%Y-%m-%d')
