/* Procedure structure for procedure `sp_insertar_producto` */

drop procedure if exists `sp_insertar_producto`;

DELIMITER $$

CREATE DEFINER=`root`@`%` PROCEDURE `sp_insertar_producto`(
IN i_codigo VARCHAR(20),
IN i_nombre varchar(60),
IN i_descripcion varchar(160),
IN i_existencia integer,
IN i_precio_venta float,
IN i_categoria integer,
IN i_presentacion integer,
IN i_precio_compra float,
in i_total  float,
IN i_parent varchar(20),
in i_proveedor integer,
IN i_tipo       integer,
in i_sucursal   integer,
in i_codigoemp  integer
)
BEGIN
if (i_tipo = 1) then
start transaction;
if (i_parent= '') then

if (i_sucursal = 0) then

select i_codigo, suc_codigo, 0
from frm_sucursal
where suc_codigo != 0;
else

end if;
else

if (i_sucursal = 0) then

select i_codigo, suc_codigo, 0
from frm_sucursal
where suc_codigo != 0;
else

end if;
end if;
if (i_existencia > 0) then
select ifnull(max(com_id),0) + 1 from frm_compra into @w_id_compra;


end if;
COMMIT;
end if;
if (i_tipo = 4) then
select ifnull(max(com_id),0) + 1 from frm_compra into @w_id_compra;

end if;
if (i_tipo = 5) then
select ifnull(max(com_id),0) from frm_compra into @w_id_compra;

if exists (select 1 from frm_producto where pro_codigo = i_codigo and pro_estado = 'V') then
UPDATE frm_existencia
set exi_existencia = exi_existencia + i_existencia
where pro_codigo = i_codigo
and suc_codigo = i_sucursal;
end if;
end if;
if (i_tipo = 6) then
select ifnull(max(com_id),0) from frm_compra into @w_id_compra;
update frm_compra
set com_estado = 'A'
where com_id = @w_id_compra;
end if;
if (i_tipo = 2) then
update frm_producto
set pro_nombre = i_nombre,
pro_descripcion = i_descripcion,
pro_existencia = i_existencia,
pro_precio_venta = i_precio_venta,
pro_presentacion = i_presentacion,
pro_categoria = i_categoria,
pro_parent = i_parent
where pro_codigo = i_codigo
and  pro_estado = 'V';
end if;
if (i_tipo = 3) then
update frm_producto
set pro_estado = 'E'
where pro_codigo = i_codigo
and  pro_estado = 'V';
end if;
if (i_tipo = 11) then
SELECT trs_cant_origen, trs_cant_destino
FROM frm_prm_traslado
WHERE pro_cod_origen = i_codigo
AND   pro_cod_destino = i_parent
into @w_cant_origen, @w_cant_destino;
SELECT exi_existencia
FROM frm_existencia
WHERE pro_codigo = i_codigo and suc_codigo = i_sucursal into @w_existencia;
IF (@w_existencia >= @w_cant_origen) then
start transaction;
update frm_existencia
set exi_existencia = exi_existencia - @w_cant_origen
where pro_codigo = i_codigo
and suc_codigo = i_sucursal;
update frm_existencia
set exi_existencia = exi_existencia + @w_cant_destino
where pro_codigo = i_parent
and suc_codigo = i_sucursal;
select ifnull(max(tra_id),0)+1 from frm_traslado into @w_count;

commit;
END IF;
end if;
END$$

