CREATE DEFINER=`root`@`%` PROCEDURE `sp_insertar_venta`(
in i_opcion int,
IN i_total float,
IN i_cantidad integer,
IN i_descuento float,
IN i_subtotal float,
IN i_cte_codigo varchar(25),
IN i_suc_codigo integer,
IN i_emp_codigo integer,
IN i_pro_codigo  varchar(20)
)
BEGIN
if (i_opcion = 1) then 
select ifnull(count(vta_codigo),0) + 1 from frm_venta
into @w_id_venta;

end if;
if (i_opcion = 21) then
select ifnull(count(vta_codigo), 0) from frm_venta into @w_id_venta;

update frm_producto
set pro_existencia = pro_existencia - i_cantidad
where pro_codigo = i_pro_codigo;
end if;
if (i_opcion = 2) then
select ifnull(count(vta_codigo), 0) from frm_venta into @w_id_venta;

update frm_existencia
set exi_existencia = exi_existencia - i_cantidad
where pro_codigo = i_pro_codigo
and   suc_codigo = i_suc_codigo;
end if;
if (i_opcion = 3) then
select ifnull(count(vta_codigo), 0) from frm_venta
into @w_i_venta;
update frm_venta
set  vta_estado = 'A'
where vta_codigo = @w_i_venta;
end if;
END$$

