DELIMITER $$

CREATE DEFINER=`root`@`%` PROCEDURE `sp_prueba`(
)
BEGIN
declare exit handler for not found rollback;
start transaction;
update frm_existencia
set exi_existencia = exi_existencia + 1
where suc_codigo = 2
and pro_codigo = 'ESP001';
select ROW_COUNT() into @w_count;
update frm_existencia
set exi_existencia = exi_existencia + 1
where suc_codigo = 1
and pro_codigo = 'ESP001'
;
select row_count(), @w_count ;
commit;
END$$

