/* Procedure structure for procedure `sp_reporte` */

drop procedure if exists `sp_reporte`;

DELIMITER $$

CREATE DEFINER=`root`@`%` PROCEDURE `sp_reporte`(
i_opcion int,
i_fecha_ini varchar(10),
i_fecha_fin varchar(10)
)
BEGIN
if (i_opcion = 1) THEN 
SELECT p.pro_codigo as CODIGO,
pro_nombre as PRODUCTO,
pro_descripcion as DESCRIPCION,
c.cdet_precio as PRECIO_COMPRA,
p.pro_precio_venta as PRECIO_VENTA
FROM frm_cdetalle c, frm_producto p
where c.pro_codigo = p.pro_codigo
ANd   p.pro_estado = 'V'
;
end if;
if (i_opcion = 2) THEN
drop table if exists temp;
create temporary table temp (tm_compras float, tm_ventas float)
;
SELECT ifnull(sum(com_total),0)  FROM frm_compra
WHERE date_format(com_fecha, 'Y%-%m-%d') >= date_format(i_fecha_ini, 'Y%-%m-%d')
AND date_format(com_fecha, 'Y%-%m-%d') <= date_format(i_fecha_fin, 'Y%-%m-%d')
and com_estado = 'A' into @w_total_compra
;
SELECT ifnull(sum(vta_total),0)  FROM frm_venta
WHERE date_format(vta_fecha, 'Y%-%m-%d') >= date_format(i_fecha_ini, 'Y%-%m-%d')
AND date_format(vta_fecha, 'Y%-%m-%d') <= date_format(i_fecha_fin, 'Y%-%m-%d')
and vta_estado = 'A' into @w_total_venta
;

;
select tm_compras as COMPRAS, tm_ventas as VENTAS, (tm_ventas-tm_compras) as GANANCIA
from temp
;
end if;
END$$

