/* Procedure structure for procedure `sp_reversa` */

drop procedure if exists `sp_reversa`;

DELIMITER $$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_reversa`(
in i_tipo char(10),
in i_empleado int,
in id_cv    int
)
BEGIN
DECLARE done INT DEFAULT 0;
DECLARE w_cantidad int;
DECLARE w_pro_codigo VARCHAR(20);
declare reversa_cursor cursor for
select vdet_cantidad, pro_codigo
from frm_vdetalle where vta_codigo = id_cv;
declare reversa_cursor2 cursor for
select cdet_cantidad, pro_codigo
from frm_cdetalle where com_id = id_cv;
DECLARE CONTINUE HANDLER FOR NOT FOUND  SET done = 1;
IF (i_tipo = 'Venta') THEN
start transaction;
update frm_venta
set vta_estado = 'X'
where vta_codigo = id_cv;
select suc_codigo from frm_venta where vta_codigo = id_cv into @w_sucursal;
open reversa_cursor;
get_run: LOOP
fetch reversa_cursor into w_cantidad, w_pro_codigo;
if done= 1 then
LEAVE get_run;
end if;
update frm_existencia
set exi_existencia =  exi_existencia + w_cantidad
where pro_codigo = w_pro_codigo
and  suc_codigo = @w_sucursal;
end loop get_run;
close reversa_cursor;

commit;
END IF;
IF (i_tipo = 'Compra') THEN
start transaction;
update frm_compra
set com_estado = 'X'
where com_id = id_cv;
select suc_codigo from frm_compra where com_id = id_cv into @w_sucursal;
open reversa_cursor2;
get_run: LOOP
fetch reversa_cursor2 into w_cantidad, w_pro_codigo;
if done= 1 then
LEAVE get_run;
end if;
update frm_existencia
set exi_existencia =  exi_existencia - w_cantidad
where pro_codigo = w_pro_codigo
and  suc_codigo = @w_sucursal;
end loop get_run;
close reversa_cursor2;

commit;
END IF;
END$$

