/* Procedure structure for procedure `sp_utilidades` */

drop procedure if exists `sp_utilidades`;

DELIMITER $$

CREATE DEFINER=`root`@`%` PROCEDURE `sp_utilidades`(
in i_pro_codigo varchar(20)
)
BEGIN
DECLARE done INT DEFAULT 0;
DECLARE done2 INT DEFAULT 0;
DECLARE vcantidad, ccantidad, acantidad, acant, a, b float default 0;
DECLARE  producto VARCHAR(20);
DECLARE vprecio, cprecio, aprecio, pprecio float default 0;
DECLARE codigo_venta, codigo_venta_ant int default 0;
DECLARE id_ant int default 1;
DECLARE bandera bool default FALSE;
declare compra cursor for
select sum(cdet_cantidad), cdet_precio,  pro_codigo
from frm_cdetalle cd, frm_compra c
where c.com_id = cd.com_id
and pro_codigo = i_pro_codigo
and com_estado = 'A'
group by cdet_precio, pro_codigo
order by cdet_precio desc
;
DECLARE EXIT HANDLER FOR NOT FOUND SET done = 1;
truncate table frm_prueba;
open  compra; 
compra_loop: LOOP
if acantidad > 0 and aprecio > 0 then
set pprecio = aprecio / acantidad;
update frm_prueba
set frm_prueba.vcantidad = acantidad, frm_prueba.vprecio = pprecio,
diferencia = ((frm_prueba.vprecio * frm_prueba.vcantidad) - (frm_prueba.cprecio * frm_prueba.ccantidad)),
numero = (frm_prueba.ccantidad) - (frm_prueba.vcantidad)
where id = a;
set codigo_venta = codigo_venta_ant;
set acantidad = 0;
set pprecio = 0;
set aprecio = 0;
set  bandera =  true;
end if;
fetch compra into ccantidad, cprecio, producto;
set acant = acant + ccantidad;
set a =  a + 1;

if done = 1 then
leave compra_loop;
end if;
bloq: begin
declare venta cursor for
select v.vta_codigo ,vdet_cantidad, vdet_subtotal from frm_vdetalle vd, frm_venta v
where v.vta_codigo = vd.vta_codigo
and pro_codigo = i_pro_codigo
and vta_estado = 'A'
and v.vta_codigo > codigo_venta
union
select v.vta_codigo , vdet_cantidad/2, vdet_subtotal from frm_vdetalle vd, frm_venta v, frm_producto p
where v.vta_codigo = vd.vta_codigo
and vd.pro_codigo = p.pro_codigo
and pro_parent = i_pro_codigo
and pro_presentacion = 7
and pro_parent!=p.pro_codigo
and vta_estado = 'A'
and v.vta_codigo > codigo_venta
order by vta_codigo
;
DECLARE EXIT HANDLER FOR NOT FOUND SET done2 = 1;
open venta; 
venta_loop:  LOOP
set codigo_venta_ant = codigo_venta;
fetch venta into codigo_venta,vcantidad, vprecio;
set aprecio = aprecio + vprecio;
set acantidad = acantidad + vcantidad;
set b =  b + 1;
if acantidad = ccantidad then
set done = 0;
set done2 = 0;
set pprecio = aprecio / acantidad;
update frm_prueba
set frm_prueba.vcantidad = acantidad, vprecio = pprecio,
diferencia = ((frm_prueba.vprecio * frm_prueba.vcantidad) - (frm_prueba.cprecio * frm_prueba.ccantidad)),
numero = (frm_prueba.ccantidad) - (frm_prueba.vcantidad)
where id = a;
set acantidad = 0;
set pprecio = 0;
set aprecio = 0;
set bandera =  false;
leave venta_loop;
end if;
if acantidad > ccantidad then
set acantidad = acantidad - vcantidad;
set aprecio = aprecio - vprecio;
set done = 0;
set done2 = 0;
set pprecio = aprecio / acantidad;
update frm_prueba
set frm_prueba.vcantidad = acantidad, frm_prueba.vprecio = pprecio,
diferencia = ((frm_prueba.vprecio * frm_prueba.vcantidad) - (frm_prueba.cprecio * frm_prueba.ccantidad)),
numero = (frm_prueba.ccantidad) - (frm_prueba.vcantidad)
where id = a;
set pprecio = 0;
set acantidad = 0;
set aprecio= 0; 
set codigo_venta = codigo_venta_ant;
set  bandera =  false;
leave venta_loop; 
end if;
end loop venta_loop;
close venta;
end bloq;
end loop compra_loop;
close compra;
SELECT * FROM frm_prueba;
END$$

