CREATE DEFINER=`root`@`%` PROCEDURE `sp_ventas_report`()
BEGIN
DECLARE id_venta int default 0;
DECLARE id_compra int default 0 ; 
DECLARE id_max_venta int default 0;
declare cantidad_venta int ;
declare producto_venta varchar(30) ; 
declare precio_venta float ; 
declare subtotal_venta float ;
declare cantidad_compra int ;
declare producto_compra varchar(30) ; 
declare precio_compra float ; 
declare subtotal_compra float ;
drop table if exists venta_temp; 
create temporary table venta_temp (
id int auto_increment , 
producto varchar(30), 
cantidad int ,
precio float, 
subtotal float ,
primary key (id)
); 
select dtv.pro_codigo, sum(dtv.vdet_cantidad), (dtv.vdet_subtotal/ dtv.vdet_cantidad), sum(dtv.vdet_subtotal) from frm_venta hdv, frm_vdetalle dtv
where hdv.vta_codigo = dtv.vta_codigo
and hdv.vta_estado = 'A'
and dtv.vdet_subtotal > 0 
and hdv.vta_fecha between DATE_ADD(CURDATE(), INTERVAL -180 DAY) and curdate()
group by dtv.pro_codigo;
drop table if exists compra_temp; 
create temporary table compra_temp(
id int auto_increment ,
producto varchar (30) ,
cantidad int,
precio float,
subtotal float,
primary key (id)
); 
select dt.pro_codigo,sum(dt.cdet_cantidad),dt.cdet_precio,sum(dt.cdet_subtotal)
from frm_compra hd , frm_cdetalle dt
where hd.com_id = dt.com_id 
and hd.com_fecha between DATE_ADD(CURDATE(), INTERVAL -180 DAY) and curdate()
and hd.com_estado ='A'
group by dt.pro_codigo, dt.cdet_precio; 
drop table if exists reporte_compra ; 
create temporary table reporte_compra(
producto varchar(30), 
cantidad int ,
precio_compra float null,
subtotal_compra float null ,
precio_venta float null, 
subtotal_venta float null ,
ganancia float null
); 
select max(id) into id_max_venta from venta_temp ; 
while id_venta <= id_max_venta do
select producto, cantidad,precio 
into producto_venta, cantidad_venta, precio_venta
from venta_temp 
where id = id_venta ;
while cantidad_venta > 0 do
set subtotal_compra = 0;
set subtotal_venta = 0 ; 
select id, cantidad,precio
into id_compra, cantidad_compra, precio_compra
from compra_temp
where producto =producto_venta 
and cantidad >0 limit 1 ;
if cantidad_compra >= cantidad_venta  then 
update compra_temp 
set cantidad = cantidad - cantidad_venta
where id = id_compra ;
set subtotal_compra =round( cantidad_venta*precio_compra,9);
set subtotal_venta = round((cantidad_venta*precio_venta),0); 
values  (producto_venta, cantidad_venta,precio_compra,subtotal_compra ,precio_venta,subtotal_venta ,null) ; 
set cantidad_venta = 0 ;
else
update compra_temp 
set cantidad = 0
where id = id_compra ;
set subtotal_compra = round(cantidad_compra*precio_compra,0);
set subtotal_venta = round(cantidad_compra*precio_venta,9); 
values  (producto_venta, cantidad_compra,precio_compra, subtotal_compra, precio_venta,	subtotal_venta ,null) ; 
set cantidad_venta = cantidad_venta -cantidad_compra ; 
end if ; 
end while ;
set id_venta = id_venta + 1 ; 
end while ; 
select producto, sum(cantidad),precio_compra ,sum((cantidad * precio_compra)),precio_venta,sum( (cantidad*precio_venta)) 
from reporte_compra
group by producto,precio_compra,precio_venta;
end$$

