/* Function  structure for function  `fnc_cambio_clave` */

drop function  if exists `fnc_cambio_clave`;

DELIMITER $$

CREATE DEFINER=`root`@`%` FUNCTION `fnc_cambio_clave`(
i_opcion int,
i_clave_ant varchar(80),
i_clave_nueva varchar(80),
i_cod_emp int
) RETURNS varchar(30) CHARSET latin1
BEGIN
IF (i_opcion = 1) then
IF EXISTS (SELECT 1 FROM frm_empleado WHERE  emp_codigo = i_cod_emp AND emp_clave = md5(i_clave_ant)) THEN
UPDATE frm_empleado
SET emp_clave = md5(i_clave_nueva)
WHERE emp_codigo = i_cod_emp;
RETURN 'CONTRASEÑA CAMBIADA CON EXITO';
ELSE
RETURN 'CONTRASEÑA ACTUAL INVALIDA';
END IF;
END IF;
END$$

