/* Function  structure for function  `fnc_insertar_producto` */

drop function  if exists `fnc_insertar_producto`;

DELIMITER $$

CREATE DEFINER=`root`@`localhost` FUNCTION `fnc_insertar_producto`(
i_codigo VARCHAR(20),
i_nombre varchar(60),
i_descripcion varchar(160),
i_existencia integer,
i_precio_venta float,
i_categoria integer,
i_presentacion integer,
i_precio_compra float,
i_total  float,
i_parent varchar(20),
i_proveedor integer,
i_tipo       integer,
i_sucursal   integer
) RETURNS varchar(30) CHARSET latin1
BEGIN
if (i_tipo = 6) then
select ifnull(max(com_id),0) from frm_compra into @w_id_compra;
update frm_compra
set com_estado = 'A'
where com_id = @w_id_compra;
end if;
RETURN @w_id_compra;
END$$

