/* Function  structure for function  `fnc_insertar_venta` */

drop function  if exists `fnc_insertar_venta`;

DELIMITER $$

CREATE DEFINER=`root`@`localhost` FUNCTION `fnc_insertar_venta`(
i_opcion int,
i_total float,
i_cantidad integer,
i_descuento float,
i_subtotal float,
i_cte_codigo varchar(25),
i_suc_codigo integer,
i_emp_codigo integer,
i_pro_codigo  varchar(20)
) RETURNS varchar(30) CHARSET latin1
BEGIN
if (i_opcion = 3) then
select ifnull(max(vta_codigo), 0) from frm_venta
into @w_i_venta;
update frm_venta
set  vta_estado = 'A'
where vta_codigo = @w_i_venta;
end if;
return @w_i_venta;
END$$

